  false,\n\t\"url\": null,\n\t\"notes\": \"In support of the CCP planning effort for
  the Souris River Loop Refuges, the Policy Analysis and Science Assistance Branch/Fort
  Collins Science Center (PASA) of the U.S. Geological Survey conducted visitor surveys
  at three refuges in North Dakota: Des Lacs, J. Clark Salyer, and Upper Souris National
  Wildlife Refuges. This research was conducted in order to assess visitor experience,
  perceptions, and preferences and visitor spending related to recreation on these
  public lands. This baseline information and input is needed by the refuges to inform
  their Comprehensive Conservation Plan (CCP) process. Specifically, this survey research
  assesses the characteristics of visitors and their trips, the activities in which
  visitors engage while on the refuge, details regarding their trip experience, as
  well as their preferences and attitudes about various management features, including
  existing and future conditions.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
